import os

ROOT_DIR = os.path.dirname(os.path.abspath(__file__))


def validate_temp_folder_exists_create_if_not_found():
    folder = os.path.join(ROOT_DIR, "temp_files")
    try:
        os.makedirs(folder)
    except FileExistsError:
        # directory already exists
        pass
    return folder


TEMP_FILE_FOLDER = validate_temp_folder_exists_create_if_not_found()
